import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'

const Sidebar = () => {
    return (
        <Container>
            <Row>About</Row>
            <Row>Projects</Row>
        </Container>
    )

}

export default Sidebar
